import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

import { Observable } from 'rxjs';
import {Inspektion} from "../inspektion";


@Injectable({
  providedIn: 'root'
})
export class InspektionService {
  private apiUrl = 'http://localhost:8080/api/inspektionen';

  constructor(private http: HttpClient) { }

  createInspektion(inspektion: Inspektion): Observable<Inspektion> {
    return this.http.post<Inspektion>(this.apiUrl, inspektion);
  }
}
